['/* Coached by Dukkha */
#include <stdio.h>

#define N 20
#define M 20

int main() {
	static int aa[N][M];
	int n, m, i, j, j1, j2;

	scanf("%d%d", &n, &m);
	for (i = 0; i < n; i++)
		for (j = 0; j < m; j++)
			scanf("%d", &aa[i][j]), aa[i][j]--;
	for (j1 = 0; j1 < m; j1++)
		for (j2 = j1; j2 < m; j2++) {
			int yes = 1;

			for (i = 0; i < n; i++) {
				int tmp, cnt;

				tmp = aa[i][j1], aa[i][j1] = aa[i][j2], aa[i][j2] = tmp;
				cnt = 0;
				for (j = 0; j < m; j++)
					if (aa[i][j] != j)
						cnt++;
				tmp = aa[i][j1], aa[i][j1] = aa[i][j2], aa[i][j2] = tmp;
				if (cnt > 2) {
					yes = 0;
					break;
				}
			}
			if (yes) {
				printf("YES\n");
				return 0;
			}
		}
	printf("NO\n");
	return 0;
}
